import React from "react";

import { robots } from '../robots_information/robots';
import Card from './Card';
const CardList = () => {
    const cardcomponent = robots.map((user, i) => {
        return (
            <Card
                key={i}
                id={robots[i].id}
                name={robots[i].name}
                email={robots[i].email} />
        )
    })
    return (
        <div>{cardcomponent} </div>
    )
}
export default CardList
